//const axios = require('axios');
let userValue = '';
const getIN = (event)=>{
    userValue = event.target.value;
    console.log(userValue);
}

const sub = (event)=>{
    fetch("https://vpic.nhtsa.dot.gov/api/vehicles/DecodeVin/5UXWX7C5*BA?format=json&modelyear=2011")
      .then((response)=>alert(':)'))
      .then((out)=> alert(out))
}
export {getIN, sub};
